import React, { useState } from "react";
import { Button,Form } from 'semantic-ui-react';
import axios from "axios";
import { useNavigate } from "react-router";

export default function CreateReportes() {
  let history = useNavigate();
  const [_id, setID] = useState(null);
  const [indicador, setFirstName] = useState('');
  const [categoria, setLastName] = useState('');
  const [descripcion, setDescripcion] = useState('');
  const [fecha_inicio, setFechaInicio] = useState('');
  const [fecha_terminacion, setFechaTerminacion] = useState('');
  const [formula, setFormula] = useState('');
  const [frecuencia, setFrecuencia] = useState('');
  const [cumplimiento, setCumplimiento] = useState('');
  const [area, setArea] = useState('');

  const [error, setError] = useState('');

  const postData = () => {
    axios.post(`http://localhost:7777/api/Reportes`, {
        indicador,
        categoria,
        descripcion,
        fecha_inicio,
        fecha_terminacion,
        formula,
        frecuencia,
        cumplimiento,
        area,
    }).then(() => {
        history.push('/readReporte');
      })
      .catch((error) => {
        console.error('Error al crear el elemento:', error);
        setError('Error al crear el elemento. Por favor, inténtalo de nuevo.');
      });
  };

  return (
    <div>
      <Form className="create-form">

        <Button type="submit" onClick={postData}>
          Actualizar
        </Button>
      </Form>
    </div>
  );
}
